import api from '../config/axiosClima';
import { header } from '../config/headers';

export const Buscar = async (search) => {
	try {
		const resp = await api.get('?q=' + search + '&lang=es&appid=' + process.env.REACT_APP_API_CLIMA_TOKEN);
		return resp;
	} catch (error) {
		return error;
	}
}
